class Solution(object):
    def numberOfSubstrings(self, s):
        """
        :type s: str
        :rtype: int
        """
        # pre-process
        L = len(s)
        zeros = [-1] * (L + 1)
        for x in range(L):
            if x == 0 or s[x - 1] == '0':
                zeros[x + 1] = x
            else:
                zeros[x + 1] = zeros[x]
        print(zeros)

        # process
        ans = 0
        for x in range(1, L + 1):
            count_zero = 1 if s[x - 1] == '0' else 0
            y = x
            while y > 0 and count_zero * count_zero <= L:
                count_one = (x - zeros[y]) - count_zero
                if count_zero * count_zero <= count_one:
                    ans += min(y - zeros[y], count_one - count_zero * count_zero + 1)
                y = zeros[y]
                count_zero += 1
            # print(ans)
        return ans


s = "00011"
s = "101101"
s = "100011110101"
s = ""

solution = Solution()
print(solution.numberOfSubstrings(s))
